### Changes
- Add crate which uses feature flags to include certain program parsers.
- Parser crate has optional `mock` feature for including spec framework for testing parsers. It generates fixtures based on configured network which requests the asset, saves it to the project, loads fixture into spec for testing the parser. 
- Add metrics support (opentelemetry +Prometheus) to get metrics on accounts and transactions parsing 


```rust
#[test]
fn mint_parse_success() {
  let account = account_mock!("6dhTynDkYsVM7cbF7TKfC9DWB636TcEM935fq7JzL2ES");
  
  let mint = parse_update!(parser, account);

  assert_eq!(mint.decimals, 9);
}
```

### Parsers
- [x] Token Program
- [x] Associated Token Program
- [x] Token Extensions
